import React,{Component} from 'react';

class Department extends Component{
    render(){
        return(
            <div className="hompagebody">
                <h2>Department</h2>
                <center>
                    <div className="departmentbox">
                        <div className="singledepartmenbox">Department</div>
                    </div>
                </center>
            </div>
        );
    }
}

export default Department;
